from typing import List


class Solution:
    def minDominoRotations(self, tops: List[int], bottoms: List[int]) -> int:
        min_change = len(tops) + 1
        for i in range(1, 7):
            cnt_i_tops = 0
            cnt_i_bottoms = 0
            cnt_common = 0
            for x1, x2 in zip(tops, bottoms):
                if x1 == i:
                    cnt_i_tops += 1
                if x2 == i:
                    cnt_i_bottoms += 1
                if x1 == x2 == i:
                    cnt_common += 1
            if cnt_i_tops + cnt_i_bottoms - cnt_common == len(tops):
                if len(tops) - max(cnt_i_tops, cnt_i_bottoms) < min_change:
                    min_change = len(tops) - max(cnt_i_tops, cnt_i_bottoms)
        return min_change if min_change <= len(tops) else -1




